import React from "react";
import logo from "./logo.svg";
import "./App.css";

import { IShoppingSale } from "./api/structures/shoppings/sales/IShoppingSale";
import saleService from "./utils/service/sale.service";

interface Props {
  sale: IShoppingSale;
}

function App({ sale }: Props) {
  console.log("sale:", Array.isArray(sale.units));
  return (
    <div className="App">
      <form>
        {sale.units.map(({ id }) => (
          <div key={id}>{id}</div>
        ))}
      </form>
    </div>
  );
}

export default App;
